import React, { useState } from "react";

function submitHandler(e) {
  e.preventDefault();

}
function InputForm() {
  const [name, setName] = useState("");

  return (
    <form action="" onSubmit={submitHandler}>
      <input
        type="text"
        value={name}
        onChange={(e) => setName(e.target.value)}
      />
    </form>
  );
}

export default InputForm;
